		// Override this to set a custom banner
		protected virtual WebInterfaceControl GetBanner()
		{
			return new CoarseGrindBanner(this.GetType().Name);
		}



		private CaptionedControl InProgressWarning
		{
			get
			{
				return new CaptionedControl(new RawCodeSegment(Test.Log.StopSignIcon.ToString()), HtmlLogSystem.HTML__SPACE + HtmlLogSystem.HTML__SPACE + HtmlLogSystem.HTML__SPACE + "Test Suite \"" + tests.CurrentlyRunningSuite.Name+ "\" is in progress.", CaptionedControlOrientation.LeftOfCaption, 250);
			}
		}
